        <p><span style="color: #58666e;">Kaytee Forti DietTimothy Hay Plus Sweet Potato combines the benefits of Timothy hay with the flavor and texture variety that complement any Kaytee Forti Diet fortified food. Kaytee feeds more hay to small pets than anyone else. We pride ourselves on providing fresh, tasty, all-natural hay. Kaytee timothy hay is hand selected to ensure long fiber strands and a proper leaf to stem ratio to support your small pet&rsquo;s digestive health. At Kaytee, we understand that taste matters. Our hay tastes better because it is naturally grown and harvested with care. Our hay is grown in fertile farmland graced with abundant sunlight and nourished by cool, rocky mountain water. Naturally grown without pesticides or GMO, our farmers only grow supreme grade hay. This means, high quality and superior nutrition for your small pet. At Kaytee, we are committed to harvesting the best nature has to offer. Satisfaction Guaranteed or your money back.</span></p> <p><a href="~/link.aspx?_id=EE11AD4E4BEB45858ECDDD45ECED39EB&amp;_z=z" target="_blank">Learn More About Kaytee Hay</a></p>
